You can use the canvas context's arc() method to draw a circle:
```js
const canvas = document.querySelector('canvas');
const ctx = canvas.getContext('2d');

// Draw circle
ctx.arc(50, 50, 10, 0, 2 * Math.PI);
ctx.stroke();
```
This will draw a circle with radius 10 centered at (50, 50).
The arc() call takes:

X center point
Y center point
Radius
Start angle (0 = 3 o'clock position)
End angle (2*PI = full circle)

Then we call stroke() to actually draw the arc/circle.

